import React, { Component } from 'react'

export default class Ingredients extends Component {
  addIngredient = () => {
    console.log('adding ingredient')
  }

  render() {
    const { ingredient } = this.props
    return (
      <div onClick={this.addIngredient}>
        <li>{ingredient}</li>
      </div>
    )
  }
}
